Volvemos con otro capítulo de: “la crisis climática, más allá de lo que nos cuentan”. Esta vez traemos un documental llamado "The true cost" estrenado en 2015 y dirigido por Andrew Morgan, en el que nos muestra como la idustria textil produce y los costos que esto conlleva, desde explotación de personas, faltas a los derechos humanos, contaminación ambiental entre otros temas aún vigentes. En este review te enseñaremos que es el fast fashion y nos centraremos en los problemas que trae consigo (condiciones laborales e impacto ambiental), los principales culpables y que podemos hacer como consumidores. 

